import React, { Component } from 'react';

class Tour extends Component {
    render() {
        return (
            <article className="tour">
            <img width="200" src="https://images.pexels.com/photos/3787939/pexels-photo-3787939.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" alt=""/>
            </article>

        );
    }
}

export default Tour;
